// src/pages/HomePage.tsx

import React, { useState, useEffect, useContext } from "react";
import axios from '../utils/axiosInstance';
import { IBranch } from "../types";
import { Link } from "react-router-dom";
import { Edit, Delete } from "@mui/icons-material";
import { useNavigate } from 'react-router-dom';

// Import MUI components
import {
  Container,
  Typography,
  Table,
  TableHead,
  TableBody,
  TableRow,
  TableCell,
  Button,
  IconButton,
  CircularProgress,
  Alert,
} from "@mui/material";

// Import AuthContext
import { AuthContext } from '../context/AuthContext';

const HomePage: React.FC = () => {
  const { role } = useContext(AuthContext); // Access the role from context
  const [branches, setBranches] = useState<IBranch[]>([]);
  const [loading, setLoading] = useState<boolean>(true);
  const [error, setError] = useState<string | null>(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchBranches = async () => {
      try {
        const response = await axios.get<IBranch[]>('/api/branch');
        setBranches(response.data);
        setLoading(false);
        console.log('Fetched branches:', response.data);
      } catch (err: any) {
        console.error('Error fetching branches:', err);
        setError('Failed to load branches.');
        setLoading(false);
      }
    };

    fetchBranches();
  }, []);

  const deleteBranch = async (id: string) => {
    if (window.confirm("Are you sure you want to delete this branch?")) {
      try {
        await axios.delete(`/api/branch/${id}`);
        setBranches(branches.filter((branch) => branch._id !== id));
        console.log(`Branch ${id} deleted.`);
      } catch (err: any) {
        console.error('Error deleting branch:', err);
        setError('Failed to delete branch.');
      }
    }
  };

  if (loading) {
    return (
      <Container maxWidth="md" sx={{ mt: 4, textAlign: 'center' }}>
        <CircularProgress />
      </Container>
    );
  }

  if (error) {
    return (
      <Container maxWidth="md" sx={{ mt: 4 }}>
        <Alert severity="error">{error}</Alert>
      </Container>
    );
  }

  return (
    <Container maxWidth="md" sx={{ mt: 4 }}>
      <Typography variant="h4" align="center" gutterBottom>
        Branches
      </Typography>

      {/* Conditionally render the Add New Branch button */}
      {role === 'admin' && (
        <Button
          variant="contained"
          color="primary"
          component={Link}
          to="/create-branch"
          sx={{ mb: 2 }}
        >
          + Add New Branch
        </Button>
      )}

      <Table>
        <TableHead>
          <TableRow>
            <TableCell><strong>Name</strong></TableCell>
            <TableCell><strong>Location</strong></TableCell>
            <TableCell align="center"><strong>Actions</strong></TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {branches.map((branch) => (
            <TableRow key={branch._id} hover>
              <TableCell>{branch.name}</TableCell>
              <TableCell align="center">
                <Button
                  variant="outlined"
                  color="primary"
                  component={Link}
                  to={`/branch/${branch._id}/items`}
                  sx={{ mr: 1 }}
                >
                  View Items
                </Button>
                {role === 'admin' && (
                  <>
                    <IconButton
                      component={Link}
                      to={`/branch/${branch._id}/edit`}
                      color="primary"
                    >
                      <Edit />
                    </IconButton>

                  </>
                )}
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </Container>
  );
};

export default HomePage;
